import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { authAPI } from '../services/api';

const Login = ({ onLogin }) => {
  const [formData, setFormData] = useState({
    login: '',
    password: ''
  });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    try {
      const response = await authAPI.login(formData);
      const { access_token, user } = response.data;
      onLogin(user, access_token);
    } catch (error) {
      setError(error.response?.data?.error || 'Login failed');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{width: 1280, height: 832, position: 'relative', background: '#EBF5FD', overflow: 'hidden'}}>
      <div style={{width: 1119, height: 673, left: 118, top: 74, position: 'absolute', background: 'white', boxShadow: '0px 4px 4px 3px rgba(0, 0, 0, 0.25)', borderRadius: 20}} />

      {/* Left side content */}
      <div style={{width: 359, height: 58, left: 307, top: 143, position: 'absolute', color: '#03045E', fontSize: 50, fontFamily: 'Calibri', fontWeight: '700'}}>Welcome Back to</div>
      <div style={{width: 156, height: 58, left: 307, top: 217, position: 'absolute', color: 'black', fontSize: 50, fontFamily: 'Calibri', fontWeight: '700'}}>Back2U</div>
      <div style={{width: 295, height: 55, left: 307, top: 299, position: 'absolute', color: 'black', fontSize: 24, fontFamily: 'Calibri', fontWeight: '400'}}>Your trusted space to recover and return rightful owners</div>
      <div style={{width: 200, height: 27, left: 305, top: 397, position: 'absolute', textAlign: 'center', color: 'black', fontSize: 24, fontFamily: 'Calibri', fontWeight: '700'}}>Sign in to your account</div>

      {/* Form */}
      <form onSubmit={handleSubmit}>
        {/* Username Input */}
        <input
          type="text"
          name="login"
          placeholder="Enter your username"
          value={formData.login}
          onChange={handleChange}
          required
          style={{
            width: 380, height: 40, left: 780, top: 200, position: 'absolute',
            padding: '10px', fontSize: 16, border: '1px solid #ccc', borderRadius: 5
          }}
        />

        {/* Password Input */}
        <input
          type="password"
          name="password"
          placeholder="Enter your password"
          value={formData.password}
          onChange={handleChange}
          required
          style={{
            width: 380, height: 40, left: 780, top: 280, position: 'absolute',
            padding: '10px', fontSize: 16, border: '1px solid #ccc', borderRadius: 5
          }}
        />

        {/* Error Message */}
        {error && (
          <div style={{
            left: 780, top: 340, position: 'absolute',
            color: 'red', fontSize: 16
          }}>
            {error}
          </div>
        )}

        {/* Submit Button */}
        <button
          type="submit"
          disabled={loading}
          style={{
            width: 420, height: 66, left: 760, top: 370, position: 'absolute',
            background: '#2E72F9', borderRadius: 10, border: 'none',
            color: 'white', fontSize: 28, fontFamily: 'Calibri',
            cursor: loading ? 'not-allowed' : 'pointer'
          }}
        >
          {loading ? 'Signing In...' : 'Sign In'}
        </button>
      </form>

      {/* Sign Up Link */}
      <div style={{left: 760, top: 460, position: 'absolute', color: 'black', fontSize: 24}}>
        Don't have an account? 
        <Link to="/register" style={{color: '#2E72F9', textDecoration: 'none', marginLeft: 10}}>Sign Up</Link>
      </div>
    </div>
  );
};

export default Login;
